import styled from 'styled-components';

const Button = styled.button`
    background-color: blue;
    color: white;
    padding: 10px 20px;
    border: none;
    border-radius: 3px;
    cursor: pointer;
    &:hover {
        background-color: darkblue;
    }
`;

export default Button;
